import React from "react";
import { Link } from 'react-router-dom';

export const AddWomenShortCheckBox = props => {
    return (
        <div className = "checkbox_info">
            <input 
                key = {props.id} 
                onClick = {props.addwomenShortChecked} 
                type = "checkbox" 
                checked = {props.isChecked} 
                value = {props.value} 
                onChange={()=>{}}
